INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (236, 301, 63, '9169836579', '', '15th Floor Fort Legend Tower, 3rd Avenue cor. 31st Street, Bonifacio Global, City, Taguig, 1634 Metro Manila', 'Taguig', '', '', '', '', '', '', '14.553988', '121.046841', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/Eastvantage.jpg', '\"At Eastvantage, our mission is to create meaningful jobs for as many Filipinos as we can. Through our portfolio of premium and select clients, we provide careers that are knowledge-based, inspiring, and always with the potential for development and growth. \r\n\r\nWe are an independently-owned outsourcing company with European roots, servicing global companies that have offices in every populated continent in the world. We have been in the industry for a decade, growing from a handful to over 500 happy employees over the years. \r\n\r\nWe invite you to navigate our site to get to know who we are, to see what sets us apart in culture and thinking. Because of this, we carefully select who we work with, both customers and co-workers, which is why people happily stick with us for a wonderful amount of time. We hope to convince you to apply with us, and be part of our success story.\"				', 81);
