INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (247, 312, 63, '9178190804', '', 'Giga Tower, Bridgetowne West, 80 E. Rodriguez, Jr. Avenue, corner Ortigas Ave, Quezon City, Metro Manila', 'Quezon City', '', '', '', '', '', '', '14.5920194', '121.080202', NULL, 0, '', '1,2', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/HGS_Logo.png', 'In the Philippines since 2003, HGS now operates on a global landscape with about 40,000 employees in 65 worldwide locations delivering localized solutions.\r\n\r\nHinduja Global Solutions (HGS) is part of a multi-billion \r\ndollar conglomerate - Hinduja Group, which provides \r\noutsourcing solutions that include Back Ounce \r\nProcessing, Contact Center services, and customized IT \r\nsolutions to its global clientele comprising several \r\nFortune 500 Companies. \r\n\r\nWe operate a global network of 58 contact and delivery \r\ncenters across eleven countries, including the US, \r\nCanada, India, the Netherlands, France, Germany, Italy, \r\nJamaica, UAE, the UK, and the Philippines. \r\nHGS Philippines which opened in 2001 has five sites \r\nlocated in Quezon City, Muntinlupa City and Iloilo City. ', 0);
