INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (292, 357, 63, '9178721630', NULL, 'Level 10-1, Fort Legend Tower Corporation, 3rd Avenue, Taguig, Metro Manila, Philippines', 'Pasig', '', '', '', '', '', '', '14.5539987', '121.0468311', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/600x3401.jpg', 'JobYoDA is a GPS enabled job search platform which shows jobs on the city map and matches the potential BPO job seekers to their dream job. JobYoDA’s platform includes an iOS and Android App and a recruiter platform. We allow BPO companies to not just post jobs but also advertise their benefits, their work culture and their beautiful workspaces which would make them stand out from the hundreds of other companies which are vying for the same talent. JobYoDA is the first ever app built specifically to support hiring in BPO industry which hires close to a million people in Philippines each year.\r\nWe aspire to disrupt the Job search market by challenging the simplistic approach of the conventional job search websites where users search from the thousands of available jobs to find the one for them. Our platform is designed around what the jobseeker wants and providing them an app which will allow them to find the exact job which matches their aspirations. \r\nJobYoDA is based in Metro Manila.', 81);
