INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (330, 396, 63, '9380686661', '', 'Exl Services, Two E-com Center, Palm Coast Avenue, Pasay, Metro Manila, Philippines', '', '', '', '', '', '', '', '14.5388327', '120.9813756', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/EXLService.png', 'At EXL, we’re experts in more than analytics, operations management, and technology. We’re experts in you, and your industry. This gives us the context to look deeper to identify and capitalize on opportunities to outperform. We call it Digital Intelligence: the all-important combination of digital and domain knowledge, human and technology, coming together to create breakthrough results. Digital Intelligence is why companies in the world’s most complex industries—from insurance to healthcare to transportation—bring us their toughest challenges, their seemingly impossible goals. Headquartered in New York, EXL has more than 29,000+ professionals in locations throughout the United States, Europe, Asia, Latin America, and South Africa. We work as one committed team, with one overarching goal: to give our clients the power to transform—to move from playing catch-up to leading the pack. Because we’re not content to help our clients adapt to change. We embolden them to lead the change. \r\n', 0);
INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (331, 397, 63, '9778259999', NULL, 'Sykes Asia, Inc., Glorietta 1, Hotel Drive Makati City', 'Makati', '', '', '', '', '', '', '14.5502037', '121.0259773', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/SYKES-logo_1080.jpg', 'SYKES is a digital marketing and customer service global outsourcer, providing customer-engagement services to Global 2000 companies. We have more than 55,000 dedicated employees and more than 65 sites in more than 20 countries. We have operations in North America, Europe, Middle East, Africa, Latin America and the Asia Pacific. We provide services through multiple communication channels encompassing phone, e-mail, web, chat, social media and digital self-service.\r\n\r\nIn the Philippines, SYKES is recognized as the first multinational call center in the country. We are also the first call center to venture outside Manila and establish operations in Cebu. From only 14 employees, SYKES grew to 15,000 and now has 7 sites in the country. SYKES has more than 20 years of experience in the industry and is known for its innovative and supportive work environment.\r\n\r\nMILESTONES\r\n\r\n• 2016 PEZA Awards\r\n- Outstanding Community Project Award\r\n\r\n• 2018 Cebu IT-BPM Organization (CIB.O)\r\n- Cebu’s Top 10 IT/BPM Co', 0);
