INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (350, 416, 63, '9178064634', NULL, 'Skyrise 3, Cebu City, Cebu, Philippines', 'Cebu City', '', '', '', '', '', '', '10.3293281', '123.9070001', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', NULL, 'Qualfon is a mission-driven BPO company and a global provider of contact center services and back-office processing. With experienced BPO leadership and a strong track record of business growth dating back to our founding in 1995, Qualfon helps companies reduce costs and deliver superior customer experiences. Today, we have approximately 13,000 employees serving international brands across many industries, and strategic outsourcing locations span the United States, the Philippines, Guyana, and Mexico. Qualfon’s mission to “Be the Best BPO, Make People’s Lives Better” means we invest in our people and, in return, they take better care of you and your customers. Qualfon’s employee retention regularly exceeds the industry average, which creates a people-driven value chain: Our employees stay longer, providing you a higher quality service at a lower price.\r\n\r\n', 81);
