INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (352, 418, 0, '0', NULL, 'Skyrise 3, Jose Maria del Mar Street, Apas, Cebu City, Cebu, Philippines', 'Cebu City', '26', 'Qualfon Cebu', '1', '5', '08:00', '17:00', '10.3293014', '123.9070342', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/cebu_site.jpg', 'Qualfon Cebu, Philippines\r\n\r\nThe 2nd-Largest BPO in the 2nd-Largest City in the Philippines\r\n\r\nWith more than 3,800 employees, Qualfon Cebu Philippines is the second-largest business processing outsourcing (BPO) operation in the second-largest city in the Philippines.\r\n\r\nWhat Makes Cebu Unique for Outsourcing?\r\n\r\nHigh Value: With a cost of living 30% cheaper than Manila and wages 15% lower, Cebu is a popular choice for companies looking to move away from the high costs associated with the big city. Cebu is an established BPO location with a large college population that exceeds 220,000, due to the 11 universities and 39 colleges in the immediate area. More than 23,000 students graduate annually. With its competitive costs and rich source of talent, Cebu offers the perfect balance between top-ranking skills and affordability.\r\nAccessibility: Cebu is the most accessible place in the Philippines, with more domestic air and sea linkages than even Manila. ', 0);
