INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (355, 421, 63, '9174901956', NULL, '6F eBloc 3 Bldg Geonzon St, IT Park, Lahug Apas, Cebu City', 'Cebu City', '', '', '', '', '', '', '10.3309964', '123.9046904', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/TM_BPS_Logo.jpg', 'Tech Mahindra represents the connected world, offering innovative and customer-centric information technology services and solutions, enabling Enterprises, Associates and the Society to Rise™. Mahindra is a USD 4.9 billion company with 121,840+ professionals across 90 countries, helping over 935 global customers including Fortune 500 companies. Our innovation platforms and reusable assets connect across a number of technologies to deliver tangible business value to our stakeholders.\r\n \r\nTech Mahindra Business Process Services (BPS) is the BPO arm of Tech Mahindra which focuses on Business Process as a Service (BPaaS) and BPO services across various industries including Telecom, Financial Services, Retail, Energy, Hospitality, Hi-Tech, Agriculture, and Food & Beverage. Our approach goes beyond cost reduction to process optimization and ownership through automation and productivity improvements.\r\n\r\nTech Mahindra BPS delivers value for customers through flawless execution of a seamless suite ', 81);
