INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (367, 433, 63, '9260267299', NULL, '23F Five/Neo Bldg., 31st St., Bonifacio Global City, Taguig, Philippines', 'Cebu City', '', '', '', '', '', '', '14.555184', '121.043282', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/jpm_chase_logo_final2.jpg', 'Company Overview \r\n\r\nJPMorgan Chase & Co. (NYSE: JPM) is a leading global financial services firm with assets of $2.5 trillion and operations in more than 60 countries. The firm is a leader in investment banking, financial services for consumers, small business and commercial banking, financial transaction processing and asset management.\r\n\r\nIt began operations in the Philippines in 1961 with a representative office. Since then, the firm has expanded its presence into a fully integrated franchise, comprising Investment Banking, Treasury and Securities Services, Equity Sales and Research as well as foreign exchange and fixed income trading operations. JPMorgan Chase & Co. has a number of legal entities operating in the country, including the Manila Branch of the bank, which has a commercial banking license as well as a derivatives license, and a securities company with a seat on the Philippine Stock Exchange.', 81);
