INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (371, 437, 63, '8800746', NULL, 'Unit 32AD BPI Philam Life Building, Ayala Avenue, Makati city', 'Makati', '', '', '', '', '', '', '14.5598408', '121.0172941', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/uRz-8cAI_400x400.jpg', 'Lamudi the leading real estate platform in the Philippines, offering sellers, buyers, and renters a secure and user-friendly website to find or list properties. Serving as the connection between property seekers and sellers, Lamudi helps individuals find their ideal property for personal use or investment purposes. It is currently operational in several countries across Latin America, Africa, Middle East, and Southeast Asia.\r\n\r\nOur Philippine team is dedicated to empowering property consumers by providing them with over 100,000 listings, and by supplying the most relevant and up-to-date information in the real estate market today through our Journal, research articles, and annual whitepaper.\r\n\r\nLamudi is an online venture by Rocket Internet, the company behind websites like Lazada, Zalora, Groupon, Foodpanda, and Carmudi. Backing from the largest, fastest, and most successful international website builder and accelerator has transformed Lamudi into an innovative company that offers tremend', 0);
INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (372, 438, 0, '0', NULL, 'Unit 32AD BPI Philam Life, Ayala Avenue, Makati city', 'Makati', '1', '', '1', '5', '08:00', '05:00', '14.55954', '121.0172778', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/optimized-philam_2.jpg', 'The Philippines\' #1 Real Estate Marketplace\r\n\r\nLamudi.com.ph is the leading real estate platform in the Philippines. We offer sellers, buyers, and renters a secure and easy-to-use platform to find or list properties online. By connecting developers, real estate agents, and private owners with property seekers, Lamudi Philippines helps individuals find their ideal house, condominium, lot, or commercial property whether for personal use or for investment purposes. Our dedicated team aims to empower consumers by providing them over 100,000 listings to choose from, and by supplying the most relevant and up-to-date information in the real estate market today through our Journal, research articles and annual whitepaper.', 0);
