INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (378, 444, 63, '9166062332', NULL, '8F Jollibee Centre, San Miguel Avenue, Ortigas Center', 'Pasig', '', '', '', '', '', '', '14.5790755', '121.0585309', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/NEW_BB-Logo_gray_web-sq.png', 'Balsam Brands is a multi-brand e-Commerce retailer with roots in holiday and home décor. Based in Silicon Valley, the company operates market-leading website such as www.BalsamHill.com. We strive for excellence in everything we do and have been honored to receive the following awards as a result:\r\n\r\nForbes: America’s Best Small Companies (2016)\r\nInc. 5000: America’s Fastest Growing Private Companies (2012, 2013, 2014, 2015)\r\nSan Francisco Business Times: Fast 100 – Fastest Growing Bay Area Companies (2012, 2013, 2014, 2015)\r\nSilicon Valley Business Journal: 75 Fastest Growing Private Companies (2012, 2013, 2014, 2015)\r\nThe company’s outward focus on building trusted consumer brands along with its internal focus on excellence and being a great place to work have propelled it to consistent, rapid growth.\r\n\r\nBalsam International is our Regional Operating Headquarters in the Philippines functioning remotely with a team of hard-working, passionate professionals.', 81);
