INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (392, 462, 63, '9774739964', '0822876430', '4/F  1.18 Centron Building, E. Quirino Street, Davao City', 'Davao City', '', '', '', '', '', '', '7.0708522', '125.6061168', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/D_-_LOGO.jpg', 'Dash10 Managed Services was created with this goal in mind: Help make business dreams come true, one website at a time. We aim to aid our expanding client base to attain impressive sales and marketing results through a combination of ingenuity, and science.\r\n\r\nWe’re looking for champions to join us in our mission. We need people who are passionate about their craft as we are passionate about web design, digital marketing, pizza, and cake.\r\n\r\nDASH TO YOUR DREAM CAREER\r\n\r\nApply now and enjoy competitive compensation and benefits, and a whole lot of other perks!\r\n\r\n\r\n\r\n\r\nWHY JOIN US?\r\nWork-Life Balance, Fun working environment, Competitive salary, Regular Team Lunch and company outings, Free healthcare for you and your family.\r\n', 81);
