INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (420, 490, 63, '9053376325', NULL, 'GF One Ecom, Harbor Drive, MOA complex, Pasay City', 'Pasay', '', '', '', '', '', '', '14.5381691', '120.9816237', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/absi.jpg', 'We offer business process outsourcing on broad range of services from customer relationship management, back office transaction processing to industry specific solutions. The key element of services delivery is an integrated approach towards providing increasing value over the entire course of our client relationships. This involves a phased approach towards process standardization, process optimization and process re-engineering. By outsourcing to us we standardize policies and procedures and improve turnaround time for activities. Our objective is to enable our customers move up the risk-reward curve by providing them the benefits of outsourcing while effectively managing and mitigating risks associated with off-shoring based on our experience and process management skills. Our focus is on building long and deep relationships with our clients, and we view ourselves as a strategic extension of their capacity and not as an external agency.', 81);
