INSERT INTO `recruiter_details` (`id`, `recruiter_id`, `phonecode`, `phone`, `landline`, `address`, `city`, `region`, `site_name`, `dayfrom`, `dayto`, `from_time`, `to_time`, `latitude`, `longitude`, `domain`, `rphonecode`, `recruiter_contact`, `comm_channel`, `recruiter_email`, `registration`, `rating`, `gross_salary`, `basic_salary`, `work_off`, `annual_leave`, `job_type`, `companyPic`, `companyDesc`, `industry`) VALUES (642, 719, 63, '9985892669', NULL, 'Mall of Asia, Pasay, Metro Manila, Philippines', 'Pasig', '', '', '', '', '', '', '14.5349838', '120.9826825', NULL, 0, '', '', '', '', 0, '0', '0', '', 0, '', 'https://jobyoda.com/recruiterupload/Company_logo_500x2805.png', 'Conduent delivers mission-critical ?services and solutions on behalf of businesses and governments – creating exceptional outcomes for its clients and the millions of people who count on them. Through people, process and technology, Conduent solutions and services automate workflows, improve efficiencies, reduce costs and enable revenue growth. It’s why most Fortune 100 companies and over 500 government entities depend on Conduent every day to manage their essential interactions and move their operations forward. \r\n\r\nConduent’s differentiated services and solutions improve experiences for millions of people every day, including two-thirds of all ?insured patients? in the U.S., 11 million employees who use its HR Services, and nearly nine million people who travel through ?toll systems  daily. Conduent’s solutions deliver exceptional outcomes for its clients including $17 billion in savings from medical bill review for workers compensation claims, up to 40% efficiency increase in HR operations, and up to 40% improvement in processing costs, while driving higher end-user satisfaction. Learn more at www.conduent.com.', 81);
