INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (6, 556, 'Are You Hiring?', NULL, 'Your complete profile will help us push the right jobs matching your profile to you and also when you apply for a job,recruiters would be able to see what you want to showcase about your skillsets.', 0, '2020-02-21 07:01:57', '2020-03-30 10:36:50');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (7, 557, 'Joan Lopena', 'Jobyoda', 'Test', 0, '2020-03-22 14:17:22', '2020-03-22 14:17:22');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (10, 566, 'test', 'Test', 'test testimonial', 0, '2020-03-30 05:11:28', '2020-03-30 05:11:28');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (11, 357, 'I hope to never use this app again :)', '', 'It\'s very easy to use. It helped me get my first job. And it was the first job posting I applied to through this app too! Being able to see job postings through the map view really helped me find a job in a location that worked for me. 10/10. I hope to never use this app again. But if I ever find myself unemployed again, I\'ll be looking for my next one through this app!', 1, '2020-04-01 04:56:06', '2020-04-01 04:58:53');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (12, 357, 'RELIABLE!', '', 'JobYoDA helped me to find a job smooth and easy. There are things that need to be improved and I believe that they are working on it now. But the experience was fast and certainly, R E L I A B L E. Thanks JobYodDA!', 1, '2020-04-01 05:00:09', '2020-04-01 05:01:02');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (13, 357, 'Got hired + more! :)', '', 'Easy and convenient to schedule for an interview. Appreciated the follow up from JobYoda regarding the interview and got a reward as well. What is it? Secret! Just give it a try. Still limited number of jobs available but good enough.', 1, '2020-04-02 02:52:34', '2020-04-02 02:56:24');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (14, 357, 'for Jobseekers and Recruiters alike!', '', 'This app is very easy to use and very convenient. Anyone who is looking for a job or recruiters who are looking for applicants can use this. In just one click you are ready to go.', 1, '2020-04-02 02:53:31', '2020-04-02 02:56:39');
INSERT INTO `recruite_testimonials` (`id`, `company_id`, `name`, `cname`, `description`, `status`, `created_at`, `updated_at`) VALUES (15, 357, 'Highly Recommended!', '', 'This app really an amazing work provider and search. As it is so fast in terms of processing and the employers are very responsive. This is highly recommended for my friends to install and look for opportunities. ????', 1, '2020-04-02 02:55:29', '2020-04-02 02:56:09');
