INSERT INTO `static_content` (`id`, `title`, `content`, `added_at`) VALUES (3, 'about us', '<p>JobYoDA is a GPS enabled job search platform which shows jobs on the city map and matches the potential BPO job seekers to their dream job. JobYoDA&rsquo;s platform includes an iOS and Android App and a Recruiter platform. We allow BPO companies to not just post jobs but also advertise their benefits, their work culture and their beautiful workspaces which would make them stand out from the hundreds of other companies which are vying for the same talent. JobYoDA is the first ever app built specifically to support hiring in BPO industry which hires close to a million people in Philippines each year.</p>\r\n\r\n<p>We aspire to disrupt the Job search market by challenging the simplistic approach of the conventional job search websites where users search from the thousands of available jobs to find the one for them. Our platform is designed around what the jobseeker wants and providing them an app which will allow them to find the exact job which matches their aspirations.</p>\r\n\r\n<p>JobYoDA is based in Metro Manila and counts many seasoned BPO execs amongst its founders.</p>\r\n', '2019-06-04 10:22:12');
INSERT INTO `static_content` (`id`, `title`, `content`, `added_at`) VALUES (6, 'Privacy Policy', '<p><a name=\"_gjdgxs\"></a> Effective Date: <strong>Aug 20, 2019</strong></p>\r\n\r\n<p>Hello, At JobYoDA.com website and JobYoDA mobile application, your data privacy is really important. Kindly read this document on Privacy Notice carefully as it forms part of the terms of use which govern the use of JobYoDA IT APP Services and the JobYoDA.com Websites Services (hereafter either or combined of JobYoDA IT platform services referred to JobYoDA.com Services).</p>\r\n\r\n<p>Scope of the Privacy policy notice -</p>\r\n\r\n<p>This privacy policy applies to the users of JobYoDA.com website and the JobYoDA mobile application &ldquo;JobYoDA.com Services&rdquo;. which may include recruiters, jobseekers and any other person using the mentioned for purposes as defined in the terms. This further explains the type of personal information the purposes for which JobYoDA collects and processes such personal information and how it would be used.</p>\r\n\r\n<p>Any changes to the privacy policy would be notified to you via a suitable announcement on the JobYoDA.com website and/or JobYoDA mobile application. The changes will apply to the use of the JobYoDA.com Services after JobYoDA have given you notice. If you do not wish to accept the new Terms you should not continue to use the JobYoDA.com Services. If you continue to use the JobYoDA IT APP Services and/or the JobYoDA.com Websites (&ldquo;JobYoDA.com Services&rdquo;) after the date on which the changes come into effect, your use of the JobYoDA IT APP Services and/or the JobYoDA.com Websites indicates your agreement to be bound by the new Terms.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>COLLECTION OF INFORMATION</strong></p>\r\n\r\n<p>JobSeekers, location, nationality, academic &amp; work credentials, salary, resume, photo etc.</p>\r\n\r\n<p>Whenever the personal information requested by JobYoDA.com Services is marked as &ldquo;Required Field&rdquo;, you must provide and agree to the processing of this personal informati</p>\r\n\r\n<p>Every time a user downloads and registers on the JobYoDA.com Services you would be asked to provide personal information through the various forms and would be proceeded with only after a valid consent provided by you. By giving such valid consent the user understands, agrees and consent to the collection, use and storage of personal information including name, email address, phone number, date of birth on by JobYoDA.com Services. If you do not agree to provide this personal information and/or not agree to us processing it in the manner set out in this Privacy Notice, then JobYoDA will be unable to provide the relevant services.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Recruiter Companies</p>\r\n\r\n<p>JobYoDA.com Services collects the company name, business address and billing address of Recruiter Companies. It also collects the name, email address and phone number of a primary contact (also referred to on the Site as the &lsquo;administrator&rsquo;). Administrator can choose to add additional sub recruiters to their account, in which case JobYoDA.com will collect the name and email address of those other users. Administrator can change the company name, billing address, or any other details by contacting the designated</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>Jobseekers and Recruiters</p>\r\n\r\n<p>If you choose to use JobYoDA.com Services to refer to a friend about its services, JobYoDA will ask for your friend&rsquo;s name, mobile number and/or email address. An email, message, WhatsApp, Viber, messenger, LinkedIn or other electronic communication modes inviting your friend to use the JobYoDA.com Services, will be sent to him/her automatically. The giving of this information represents that you have obtained your friend&rsquo;s consent for his/her name, phone number and email address to be given to JobYoDA Inc.</p>\r\n\r\n<p>In addition, JobYoDA.com Services may ask your permission to post your success story or testimonial. If you agree to post your material on JobYoDA IT APP or Websites (JobYoDA.com Services), you should be aware that any personal information you submit can be read, collected, or used by other users of the JobYoDA.com Services and could be used to send you unsolicited messages. If you wish to update or delete your success stories or testimonial, you can contact us at <a href=\"mailto:help@jobyoda.com\">help@jobyoda.com</a>.</p>\r\n\r\n<p>You agree to indemnify, hold harmless and defend the JobYoDA.com Services, and its employees, officers, directors, agents, successors and assigns from and against damages, penalties, losses, liabilities, judgments, settlements, awards, and costs and expenses of any kind or nature, including reasonable attorneys&rsquo; fees, suffered or incurred in connection with any claims, demands, causes of action, suits, proceedings or other actions, arising from a willful breach of the representations.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>When you visit the JobYoDA.com websites and or mobile applications.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<ul>\r\n		<li>\r\n		<p>When you visit any JobYoDA.com Websites our web servers automatically collect information about your visit to these websites, including your Internet Protocol (IP) address, the time, date and duration of your visit. your IP address is a unique identifier for your computer or other access device.</p>\r\n		</li>\r\n		<li>\r\n		<p>JobYoDA.com may track your visits to any JobYoDA.com Websites by placing a &ldquo;cookie&rdquo; on your computer or other access device when you enter. Cookies are small text files that are placed on your computer or other access device by websites that you visit. They are widely used in order to make websites work, or work more effectively, as well as to provide information to the owners of the websites.</p>\r\n		</li>\r\n		<li>\r\n		<p>Cookies allow JobYoDA.com to save preferences for you so that you will not have to re-enter them the next time you visit. Cookies also help JobYoDA.com collect anonymous click stream data for tracking user trends and patterns. JobYoDA.com may use the anonymous click stream data to help the Advertiser to deliver better-targeted advertisements.</p>\r\n		</li>\r\n		<li>\r\n		<p>You can remove cookies by following directions provided in your internet browser&rsquo;s &ldquo;help&rdquo; file. You should understand that areas of certain websites will not function properly if you set your internet browser to not accept cookies.</p>\r\n		</li>\r\n		<li>\r\n		<p>JobYoDA.com also uses clear gifs in its HTML-based emails in order to find out which emails have been opened by the recipients. This allows JobYoDA.com to gauge the effectiveness of certain communications and the effectiveness of its marketing campaigns.</p>\r\n		</li>\r\n		<li>\r\n		<p>Our partners and service providers use cookies to collect information about the usage of JobYoDA.com Websites. The use of cookies by our partners and service providers are not covered by our privacy policy. We do not have access or control over these cookies.</p>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>PURPOSES OF COLLECTION</strong></p>\r\n\r\n<p>The purposes for which JobYoDA.com Services collects and processes your personal information includes tasks such as authenticate your identity, to administer and manage the JobYoDA.com Services provided to you, to provide information on the right job matching with your qualifications, experience and other benefits chosen by you. We would use the same also to contact you about any changes to the product or services as also for any marketing research and statistical purposes. To monitor and improve the performance of JobYoDA.com Services, to investigate and resolve any enquiries, complaints or any other concerns raised through <a href=\"mailto:help@jobyoda.com\">help@jobyoda.com</a>,</p>\r\n\r\n<p>The collection and processing, including the use, sharing and retention of information shall only be for valid purposes and to the extent necessary to achieve those purposes. Where necessary for any of the above purposes, JobYoDA.com or its service providers shall use automated processes such as artificial intelligence and data analytics in relation to your personal information.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>PROCESSING AND SHARING OF INFORMATION</strong></p>\r\n\r\n<p>JobYoDA.com Services aims to provide best in class and highly disruptive application to jobseekers that enables them to choose jobs on the basis of user preferences such as location proximity, shift timings, medical benefits, joining bonus etc. We aim to bring the right kind of job to the right kind of candidate by letting recruiters and job seekers see eye to eye. Through the various filters available on the recruiter portal as well as the JobYoDA application the platform seeks to achieve this aim. The information provided by the jobseeker would be used for the said purposes and as such shared with the recruiters matching the requirements. The JobYoDA platform also allows the jobseeker to find a suitable job and apply for the same. The user can also directly communicate with the recruiter through text, Whatsapp, Viber or other telecommunication channels. JobYoDA shall not be responsible under this policy for the availability, accessibility and storage of information outside the JobYoDA platform. Also JobYoDA is not a party to such arrangements including employee onboarding, administration of employee benefits, finalization of hired candidates KPI&rsquo;s or any other tasks that construes JobYoDA as a recruitment company. Also note that the information independently disclosed to recruiters outside the JobYoDA platform shall not be covered by this privacy policy.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>STORAGE, RETENTION AND DELETION OF INFORMATION</strong></p>\r\n\r\n<p>JobYoDA.com Services will retain your personal information for the period necessary or deemed fit to fulfil the purposes as defined in this privacy policy or any legal or business purposes.</p>\r\n\r\n<p>You may request for deletion of your JobYoDA account at any time in which event JobYoDA.com Services will remove all access to your account, resume and JobYoDA Profile in the database. The deletion of your JobYoDA account does not affect JobYoDA Profile that you had already sent to Recruiters or were previously downloaded by recruiters</p>\r\n\r\n<p>JobYoDA.com is committed to keeping personal information secure. JobYoDA.com has appropriate technical, administrative and physical procedures in place to protect personal information from loss, theft and misuse, as well as against unauthorized access, disclosure, alteration and destruction. No method of transmission over the Internet, or method of electronic storage, is 100% secure, however. Therefore, we cannot guarantee its absolute security. If you have any questions about security on our Website, you can contact us at <a href=\"mailto:help@jobyoda.com\">help@jobyoda.com</a>. JobYoDA shall duly investigate to resolve data breaches in adherence to breach management procedures described by the local laws and regulations as applicable.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>USER OBLIGATIONS REGARDING PERSONAL INFORMATION</strong></p>\r\n\r\n<p>You are responsible for providing accurate, not misleading, complete and up-to-date information to JobYoDA.com Services about yourself and any other person whose personal information you provide us and for updating this personal information as and when it becomes inaccurate, misleading, incomplete and out-of-date by contacting JobYoDA.com Services.</p>\r\n\r\n<p><strong>USER CONSENT</strong></p>\r\n\r\n<p>In using the JobYoDA.com Services, you consent to the collection and use of the personal information by JobYoDA.com in the ways described hereinabove (which may change from time to time) unless and until you inform JobYoDA.com to the contrary at help@jobyoda.com</p>\r\n\r\n<p><strong>CONTACT INFORMATION</strong></p>\r\n\r\n<p>If you still have questions about this Privacy Notice, please visit JobYoDA.com or reach out to <a href=\"mailto:help@jobyoda.com\">help@jobyoda.com</a> or you may also contact Data Privacy Officer through the following email address:</p>\r\n\r\n<p>Email Address: dataprivacyofficer@JobYoDA.com</p>\r\n\r\n<p>JobYoDA.Inc.</p>\r\n\r\n<p>Level 10-1 Fort Legend Tower, 3rd Avenue Bonifacio Global City, 31st street Fort Bonifacio Taguig City, Fourth District, NCR Philippines 1634.</p>\r\n', '2019-10-07 05:41:58');
