INSERT INTO `success_stories` (`id`, `user_id`, `recruiter_id`, `story`, `status`, `createdon`) VALUES (8, 27139, 357, 'Here is my success story for joining JobYoDA. I first saw the ad on facebook and got curious because it is something new to me and I got interested so I tried installing the app. It was perfect timing for me because I was looking for a job and they had an opening that was right up my alley. Cool thing is, the app allowed me to choose what kind of benefits I wanted which lead me to an open position which fits my experience. So I applied and I got to choose my desired date and time for an interview. Honestly I was not expecting that they’d call me right away because I had experiences before that when I apply to job engines or platforms like this I’d have to wait for a week before I get a call from them and to my surprise, right after applying and scheduling myself for an interview, I received a call from them right away and they interviewed me right then and there and was able to know my interview status. Now, I am part of their team and I\'m thankful for that.', '2', '2020-05-03 14:10:02');
