#
# TABLE STRUCTURE FOR: promo_notifications
#

DROP TABLE IF EXISTS `promo_notifications`;

CREATE TABLE `promo_notifications` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `title` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `message` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `cron_status` int(11) NOT NULL DEFAULT '0',
  `save_status` int(11) DEFAULT '0',
  `badge_count` int(11) NOT NULL,
  `added_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

#
# TABLE STRUCTURE FOR: reconciliation
#

DROP TABLE IF EXISTS `reconciliation`;

CREATE TABLE `reconciliation` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `job_id` int(11) NOT NULL,
  `status` int(11) NOT NULL,
  `showupreason` longtext,
  `schedule` varchar(50) DEFAULT NULL,
  `added_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2448 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: recruiter
#

DROP TABLE IF EXISTS `recruiter`;

CREATE TABLE `recruiter` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) NOT NULL,
  `fname` varchar(200) NOT NULL,
  `lname` varchar(200) NOT NULL,
  `cname` varchar(200) NOT NULL,
  `email` varchar(250) NOT NULL,
  `password` text NOT NULL,
  `status` tinyint(1) NOT NULL,
  `active` int(11) NOT NULL DEFAULT '1',
  `salary_status` int(11) NOT NULL DEFAULT '1',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `label` int(11) NOT NULL COMMENT '1-super recruiter, 2-company site, 3- sub recruiter',
  `logincount` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=729 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: recruiter_addexp
#

DROP TABLE IF EXISTS `recruiter_addexp`;

CREATE TABLE `recruiter_addexp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recruiter_id` int(11) NOT NULL,
  `comp_id` int(11) NOT NULL,
  `exp` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=59 DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: recruiter_allowances
#

DROP TABLE IF EXISTS `recruiter_allowances`;

CREATE TABLE `recruiter_allowances` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recruiter_id` int(11) NOT NULL,
  `allowances_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2251 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: recruiter_details
#

DROP TABLE IF EXISTS `recruiter_details`;

CREATE TABLE `recruiter_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recruiter_id` int(11) NOT NULL,
  `phonecode` int(11) NOT NULL,
  `phone` bigint(20) NOT NULL,
  `landline` varchar(20) DEFAULT NULL,
  `address` varchar(250) NOT NULL,
  `city` varchar(100) NOT NULL,
  `region` varchar(100) NOT NULL,
  `site_name` varchar(100) NOT NULL,
  `dayfrom` varchar(100) NOT NULL,
  `dayto` varchar(100) NOT NULL,
  `from_time` varchar(100) NOT NULL,
  `to_time` varchar(100) NOT NULL,
  `latitude` double NOT NULL,
  `longitude` double NOT NULL,
  `domain` varchar(200) DEFAULT NULL,
  `rphonecode` int(11) NOT NULL,
  `recruiter_contact` varchar(15) NOT NULL,
  `comm_channel` varchar(255) NOT NULL,
  `recruiter_email` varchar(255) NOT NULL,
  `registration` varchar(200) NOT NULL,
  `rating` int(11) NOT NULL,
  `gross_salary` float NOT NULL,
  `basic_salary` float NOT NULL,
  `work_off` varchar(100) NOT NULL,
  `annual_leave` int(11) NOT NULL,
  `job_type` varchar(100) NOT NULL,
  `companyPic` varchar(250) DEFAULT NULL,
  `companyDesc` text NOT NULL,
  `industry` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=652 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: recruiter_leaves
#

DROP TABLE IF EXISTS `recruiter_leaves`;

CREATE TABLE `recruiter_leaves` (
