  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=155 DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: recruiter_medical
#

DROP TABLE IF EXISTS `recruiter_medical`;

CREATE TABLE `recruiter_medical` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recruiter_id` int(11) NOT NULL,
  `medical_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2289 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: recruiter_toppicks
#

DROP TABLE IF EXISTS `recruiter_toppicks`;

CREATE TABLE `recruiter_toppicks` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recruiter_id` int(11) NOT NULL,
  `picks_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1750 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: recruiter_workshift
#

DROP TABLE IF EXISTS `recruiter_workshift`;

CREATE TABLE `recruiter_workshift` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recruiter_id` int(11) NOT NULL,
  `workshift_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=177 DEFAULT CHARSET=latin1;

#
# TABLE STRUCTURE FOR: recruite_testimonials
#

DROP TABLE IF EXISTS `recruite_testimonials`;

CREATE TABLE `recruite_testimonials` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
